import React from "react";
import { MDBCarousel,MDBMask,MDBCarouselCaption, MDBCarouselInner, MDBCarouselItem, MDBView, MDBContainer } from
"mdbreact";

const CarouselPage = ({products}) => {
  return (
    <MDBContainer>
      <MDBCarousel
        activeItem={1}
        length={3}
        showControls={true}
        showIndicators={false}
        className="z-depth-1"
        slide
      >
              <MDBCarouselInner>
                  {products && products.photo.map((photo,i) => (
                      
                      <MDBCarouselItem itemId={i}>
            <MDBView>
              <img
                className="d-block w-100"
                src="https://mdbootstrap.com/img/Photos/Slides/img%20(35).jpg"
                alt="First slide"
                          />
                          
          <MDBMask overlay="black-light" />
             </MDBView>
            <MDBCarouselCaption>
                              <h3 className="h3-responsive">products.title</h3>
          </MDBCarouselCaption>
          </MDBCarouselItem>
                  ))}
          
    
        </MDBCarouselInner>
      </MDBCarousel>
    </MDBContainer>
  );
}

export default CarouselPage;
